import React from 'react';
import Nav from '../../components/nav/Nav';  // Importando o Nav
import Footer from '../../components/footer/Footer'; // Importando o Footer
import './HomePage.css'; // Estilos específicos da página

function HomePage() {
  return (
    <div>
      <Nav /> {/* Incluindo o componente de navegação */}
      <section className="home-page">
        <h1>Bem-vindo à Página Inicial!</h1>
        <p>Conteúdo específico da página inicial...</p>
      </section>
      <Footer /> {/* Incluindo o componente de rodapé */}
    </div>
  );
}

export default HomePage;
